function AddToDoForm() {

    return (
        <form action="http://127.0.0.1:8081/addtodo" method="post">
            <label>Add a new task here : 
            <input type="text" name="todo"/>
            </label>
            <button type="submit" value="submit">Add</button>
        </form>
        
    );
}

